import React,{useState} from 'react'
import Book from "../Components/Book"
import '../../src/Style.css'
const TableBox= (props)=>{
    const Books = props.Books;
    //console.log(Books)
    //console.log("dd")
    return (<div className="tableBox">
        {Books.map((book)=>{
       return <Book key={book.id} available={book.available} id={book.id} title={book.bookname} author={book.author} price={book.price} imagepath={book.imagepath}/>
        })}
    </div>)
}
export default TableBox;
